/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */


const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1 {...{
      "id": "kubectl-overview"
    }}>{`Kubectl Overview`}</h1>
    <h2 {...{
      "id": "tldr"
    }}>{`tl;dr`}</h2>
    <h3 {...{
      "id": "resources"
    }}>{`Resources`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Reference`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Resource`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`pod`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Pods`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`svc`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Services`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`ns`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Namespaces`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`rs`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Replica Sets`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`deployment`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Deployments`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`node`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Cluster nodes`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`sc`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Storage Class`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`pvc`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Persistent Volume Claim`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`secrets`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Secrets`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "actions"
    }}>{`Actions`}</h3>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Example`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`get`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Get resource`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get pods`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`describe`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Describe resource`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl describe node `}<inlineCode parentName="td">{`<NODE>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`delete`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Delete resource`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl delete pod `}<inlineCode parentName="td">{`<POD>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`create`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Create resource`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl create ns `}<inlineCode parentName="td">{`<NAMESPACE>`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "setting-config"
    }}>{`Setting config`}</h2>
    <p>{`Example exporting to set the correct `}<inlineCode parentName="p">{`KUBECONFIG`}</inlineCode>{`.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-shell"
      }}>{`export KUBECONFIG=~/.kube/eksctl/clusters/cluster
`}</code></pre>
    <h2 {...{
      "id": "base-fetching"
    }}>{`Base fetching`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Rolebindings`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get rolebinds --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=`}<inlineCode parentName="td">{`<selector>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Pods`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get pods --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=`}<inlineCode parentName="td">{`<selector>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Deployments`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get deployments --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=`}<inlineCode parentName="td">{`<selector>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Services`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get svc --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=`}<inlineCode parentName="td">{`<selector>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Replica Sets`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get replicasets --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=`}<inlineCode parentName="td">{`<selector>`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "all"
    }}>{`All`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Get rolebindings`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get all --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode>{` --selector=k8s-app=kubernetes-dashboard`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "rolebindings"
    }}>{`Rolebindings`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Get rolebindings`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get rolebindings --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Describe rolebindings`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl describe rolebindings --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Describe rolebindings for service`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl describe rolebindings `}<inlineCode parentName="td">{`<service account>`}</inlineCode>{` --namespace `}<inlineCode parentName="td">{`<namespace>`}</inlineCode></td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "namespaces"
    }}>{`Namespaces`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Action`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Command`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Create namespace`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl create namespace `}<inlineCode parentName="td">{`<NAMESPACE>`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Get namespace`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`kubectl get namespace`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "services"
    }}>{`Services`}</h2>
    <p>{`To do`}</p>
    <h2 {...{
      "id": "pods"
    }}>{`Pods`}</h2>
    <p>{`To do`}</p>
    <h2 {...{
      "id": "deployments"
    }}>{`Deployments`}</h2>
    <h2 {...{
      "id": "replica-sets"
    }}>{`Replica Sets`}</h2>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
